import React, { useState } from "react";
import { Decal, Plane, useGLTF, useTexture } from "@react-three/drei";
import { PlaneGeometry } from "three";

export default function Shoes() {
  const [meshes, setMeshes] = useState([]);

  const base64_logo = `data:image/png;base64,`;
  const fullTexture2 = useTexture(base64_logo);

  const { nodes } = useGLTF("/shoe.glb");
  console.log(nodes);

  for (let key of Object.keys(nodes)) {
    // console.log(key)
    // console.log(nodes[key])
    if (nodes[key].constructor.name == "Mesh") {
      console.log(key); // Tshirt_male
      console.log(nodes[key]);

      meshes.push(
        <mesh
          castShadow
          geometry={nodes[key].geometry}
          material-roughness={1}
          dispose={null}
          // material={new THREE.MeshStandardMaterial()}
          // material-roughness={4}
          // scale={[-3, 1, 3]}
          // rotation={[0, 0, Math.PI]}
        >
          <Decal
            position={[0, 0, 0]}
            rotation={[0, 0, 0]}
            scale={1}
            map={fullTexture2}
          />
        </mesh>
      );
    }
  }

  const material = <meshBasicMaterial color={"#122333"}></meshBasicMaterial>

  const plane_mesh = <Plane material={material} scale={[50, 50, 50]}>
	{/* <PlaneGeometry width={100}/> */}
	{/* <meshStandardMaterial/> */}
  </Plane>
  

  return <group>
	{/* {meshes} */}
	<mesh
          castShadow
          geometry={nodes.Object_2.geometry}
          material-roughness={1}
          dispose={null}
          // material={new THREE.MeshStandardMaterial()}
          // material-roughness={4}
        //   scale={[-1, 1, 1]}
          rotation={[0, 0, Math.PI]}
        >
           
          <Decal
            position={[-0.05, -0.04, -0.05]}
            rotation={[0, 0, 0]}
            scale={0.05}
            map={fullTexture2}
            //map-anisotropy={16}
            // Had to comment this, apparently my PC is not powerfoul enough to hold it!
            depthTest={false}
            depthWrite={true}
			mesh={plane_mesh}
          />
        
        </mesh>
  </group>;
}
